import React from "react";

const DetailList = (props) => {
  return (
    <div>
      {props.list.map((list) => {
        console.log(list);
        return (
          <div className="container">
            <img src={list} />
          </div>
        );
      })}
    </div>
  );
};

export default DetailList;
